from numpy import array, min, where


def function(sequence: str) \
        -> list:
    bias, record = 0, [0]
    for base in sequence:
        if base == 'C':
            bias -= 1
        if base == 'G':
            bias += 1
        record.append(bias)

    return where(record == min(record))[0]


if __name__ == '__main__':
    p = ""
    print(" ".join(list(map(str, function(sequence=p)))))
